sources.shangbo.css:
#nav{
    text-align: center;
    display:flex;
}
#nav ul{
    font-size:16px;
    font-family:"HYXinRenWenSongW";
    color:rgba(51,51,51,1);
    list-style-type:none;
    display: inline-block;
    margin:auto;
}
#nav li{
    display: inline-block;
    margin:20px;
    line-height: 30px;
    height: 30px;
}
a{
    text-decoration:none;
    color:#333333;
}
a:hover{
    background-image: url("images/hover.png");
    background-size: 36px;
    font-family: "HYRuiHuSongW";
    color:#C29A62;
}

#navsec{
    height: 300px;
    width: 1024px;
    background-color: white 0.8;
    position: absolute;
    z-index:10;
}

.banner{
    position: relative;
    width: 100%;
    height: 560px;
    overflow: hidden;
}

.banner img{
    width: 100%;
}

@font-face{
    font-family:"HYRuiHuSongW";
    src:url("HYRuiHuSongW.ttf");
    font-family:"HYXinRenWenSongW";
    src:url("HYXinRenWenSongW.ttf");
}
#logo{
    width:50px;
    height: 40px;
    margin:auto;
}
.gudian{
    background-image: url("images/button.png");
    width: 88px;
    height: 39px;
    border:none;
    color:white;
    float:right;
    font-family:"HYRuiHuSongW";
    font-size:18px;
    letter-spacing:3px;
    margin:auto;
}

.open{
background-image: url(images/open.jpg);
width: 299px;
height: 229px;
text-align:center;
display: inline-block;
margin: auto;
margin-right: 10px;
}

.h1white{
font-family: "HYRuiHuSongW";
color:white;
background-image: url(images/titlewhite.png);
background-repeat: no-repeat;
background-position: center 15px;
font-size:18px;
padding-top: 10px;
}

.h1black{
    font-family: "HYRuiHuSongW";
    color:#333333;
    background-image: url(images/title.png);
    background-repeat: no-repeat;
    background-position: center 15px;
    font-size:18px;
    padding-top: 10px;
    text-align: center;
}

.binglie{
    display:flex;
}

div.time{
    margin:0 auto;
    display: inline-block;
}

.open p{
font-size:10px;
font-family:"HYXinRenWenSongW" ;
color:white;
}
.open p.yellow{
    color:#EEB86B;
}
.open p.shuzi{
    font-size: 20px;
    font-family: "HYRuiHuSongW";
    margin:0 auto;
}


.order{
    background-image: url(images/biankuang.png);
    background-repeat: no-repeat;
    display: inline-block;
    width: 625px;
    height: 229px;
    margin: auto;
    margin-left: 20px;
}

.first{
    display:flex;
    margin: 20px auto;
}

.yuyue{
    display: inline-block;
    margin:0 auto;
    margin-top: 20px;
}


.yuyue p{
    font-size:18px;
    font-family:"HYXinRenWenSongW" ;
    color:black;
    margin-top: 4px;
}

.xuanz img{
    margin:0 auto;
}

.dianc img{
    margin:0 auto;
}

div.kuai{
    background-image: url(images/diancang.png);
    position: absolute;
    background-repeat: no-repeat;
    width: 180px;
    height: 180px;
    margin-top: 80px;
    margin-left: 300px;
    z-index: 1;
}

div.kuai p{
    font-family: "HYRuiHuSongW";
    font-size: 36px;
    color:white;
    text-align: center;
}

div.tu{
    position: absolute;
    margin-left: 800px;
    z-index: 1;
    bottom: 0;
}

div.bg{
    position: absolute;
    bottom: 0;
    width: auto;
    margin: auto;
    left: 50%;
    transform: translate( -50%);
}

div.duiqi{
    position: relative;
    top: 400px;


}

.blank{
    height: 400px;
}
div.qita{
    margin:0 auto;
    display:flex;
    justify-content:center;
}


div.tuijian{
    display: inline-block;
    padding: 10px;
    z-index: 1;
    position: relative;
    width: 460px;
    height: 232px;
    overflow: hidden;
    text-align: center;
}




div.huodong{
    display: inline-block;
    margin: 10px;
    width: 232px;
    height: 232px;
    overflow: hidden;
    position: relative;
    text-align: center;
}

div.shopvideo{
    display: inline-block;
    padding: 10px;
    text-align: center;
}

.shop{
    margin-bottom: 10px;
    width: 221px;
    height: 105px;
    overflow: hidden;
    position: relative;
    text-align: center;
}

.video{
    padding-top: 10px;
    width: 221px;
    height: 105px;
    overflow: hidden;
    position: relative;
    text-align: center;
}

.mengbang{
    background-color: rgb(0,0,0,0.7);
    background-size: 100%;
    position: absolute;
    width: 460px;
    height: 232px;
}

.mengbang:hover{
    background-color:rgba(229, 175, 99, 0.8);
    transform: translateY(0);
}

div.fenge{
    display: flex;
}
div.fenge img{
    margin:0 auto;
    margin-bottom: 40px;
    margin-top: 40px;
}



.qita p{
    font-family:  "HYRuiHuSongW";
    color:white;
    position: absolute;
    z-index: 3;
    width: 100px;
    display: inline-block;
}

.info{
    background-image: url(images/info.png);
    width: 956px;
    height: 248px;
    margin: auto;
}



.left{
    display: inline-block;
    margin:0 auto;
    vertical-align:top;
}

.right{
    display: inline-block;
}

.date{
    color:rgba(173, 163, 163, 1);
    font-size: 14px;
    font-family: "HYXinRenWenSongW" ;
    display: inline-block;
}

.biaoti{
    color:rgba(51, 51, 51, 1);
    font-size: 14px;
    font-family: "HYXinRenWenSongW" ;
    display: inline-block;
}

.hang{
    margin-left:20px;
}

.hang p{
     margin:0.4em 0em;
     vertical-align:top;

}

.news{
    display: flex;
}

.info h1{
    padding-top: 10px;
}

.kongbai{
    height: 10px;
}

.map{
    height: 368px;
    width: 952px;
    margin: auto;
}

.map img{
    margin-top: 80px;
    border-radius: 2px;
    box-shadow: 2px 2px 5px #e4e6fa;
}

.adress{
    width: 345px;
    height: 371px;
    background-image: url(images/ditu.png);
    position: absolute;
    z-index: 3;
    margin-left: 300px;
    margin-top: 40px;


}
.wen{
    padding: 20px;
}


.wen h2{
    font-family:  "HYRuiHuSongW";
    font-size: 14px;
    color: #EFBD78;
    margin-top: 60px;
}
.wen p{
    font-size: 12px;
    font-family: "HYXinRenWenSongW" ;
    color: white;
}

.weed{
display: flex;
}
.weed p{
    margin: auto;
    margin-top: 20px;
    font-size: 12px;
    font-family: "HYXinRenWenSongW" ;
    color: white;
}

.dibu{
    width: 100%;
    height: 380px;
    background-image: url(images/dibu.png);
    margin-top: 180px;
}

.dibud{
    display: flex;
}
